import './OnOffFieldGallery.css';
import img1 from '../assets/images/1.jpg';
import img2 from '../assets/images/2.jpg';
import img3 from '../assets/images/3.jpg';
import img4 from '../assets/images/4.jpg';
import img5 from '../assets/images/5.jpg';
import img6 from '../assets/images/6.jpg';
import img7 from '../assets/images/7.jpg';
import img8 from '../assets/images/8.jpg';

const OnOffFieldGallery = () => {
  return (
    <section className="gallery-section container">
      <h2>On the Field</h2>
      <div className="gallery-grid">
        {[img1, img2, img3, img4].map((src, i) => (
          <img key={i} src={src} alt={`On field ${i + 1}`} />
        ))}
      </div>
      <h2>Off the Field</h2>
      <div className="gallery-grid">
        {[img5, img6, img7, img8].map((src, i) => (
          <img key={i} src={src} alt={`Off field ${i + 1}`} />
        ))}
      </div>
    </section>
  );
};

export default OnOffFieldGallery;
